import React from 'react';
import './App.css';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>EliteHome</h1>
                <p>Welkom bij EliteHome - Nieuwe structuur</p>
            </header>
        </div>
    );
}

export default App;
